// VENDOR ROUTES
app.post('/api/listings', authenticateToken, hasRole(['vendor']), async (req, res) => {
    const { name, description, price, imageUrl } = req.body;
    try {
        const newListing = {
            vendorId: new ObjectId(req.user.userId),
            name,
            description,
            price: parseFloat(price),
            imageUrl,
            createdAt: new Date()
        };
        await db.collection('listings').insertOne(newListing);
        res.status(201).json(newListing);
    } catch (error) {
        res.status(500).json({ message: 'Failed to create listing' });
    }
});

app.get('/api/listings/my-listings', authenticateToken, hasRole(['vendor']), async (req, res) => {
    try {
        const listings = await db.collection('listings').find({ vendorId: new ObjectId(req.user.userId) }).toArray();
        res.json(listings);
    } catch (error) {
        res.status(500).json({ message: 'Failed to fetch listings' });
    }
});

